Description:
1. Nuôi nhiều tài khoản cá nhân Facebook; 
2. Post bài tự động lên các hội nhóm được chỉ định theo tài khoản cá nhân; 
3. Lấy comment về; 
4. Reply comment; 
Lưu ý: i meo jbviet a còng gờ meo; hoặc đt không chín một tám 3430 ba năm

Mình có 1 bộ source Node.js sử dụng selenium-webdriver/chrome để giả lập trình duyệt ẩn để đăng nhập vào lấy dữ liệu socket về. trước đây hoạt động bình thường, nhưng do website mục tiêu mới đổi cách xác thực và mình bị lỗi : 
NoSuchElementError: no such element: Unable to locate element: {"method":"css selector","selector":"*[id="account"]"} 
Và không thể lấy data về. Bạn nào nhận fix liên hệ mình nhé

